import React from 'react';


const InfoList = () => {
  console.log('InfoList');
  var array = [];
  const json = JSON.parse(sessionStorage.getItem('state'));
  for(var i in json) {
    array.push([i, json[i]]);
  }
  return(
    <>
      <ul>
        {array.map((pair, key) => (
          <li>{pair[0]}: {pair[1]}</li>
        ))}
      </ul>
    </>
  )
}


export default InfoList;
